import React from 'react'
import "./welcome.css";
import $ from 'jquery'; 
$('#parallax').parallax({
	invertX: true,
	invertY: true,
	scalarX: 15,
	frictionY: .1
});

window.addEventListener('DOMContentLoaded', (event) => {
particlesJS("particles-js", {
  "particles": {
    "number": {
      "value": 120,
      "density": {
        "enable": true,
        "value_area": 800
      }
    },
    "color": {
      "value": "#ffffff"
    },
    "shape": {
      "type": "circle",
      "stroke": {
        "width": 0,
        "color": "#000000"
      },
      "polygon": {
        "nb_sides": 5
      },
      "image": {
        "src": "img/github.svg",
        "width": 100,
        "height": 100
      }
    },
    "opacity": {
      "value": 0.5,
      "random": false,
      "anim": {
        "enable": false,
        "speed": 1,
        "opacity_min": 0.1,
        "sync": false
      }
    },
    "size": {
      "value": 3,
      "random": true,
      "anim": {
        "enable": false,
        "speed": 40,
        "size_min": 0.1,
        "sync": false
      }
    },
    "line_linked": {
      "enable": true,
      "distance": 150,
      "color": "#ffffff",
      "opacity": 0.4,
      "width": 1
    },
    "move": {
      "enable": true,
      "speed": 6,
      "direction": "none",
      "random": false,
      "straight": false,
      "out_mode": "out",
      "bounce": false,
      "attract": {
        "enable": false,
        "rotateX": 600,
        "rotateY": 1200
      }
    }
  },
  "interactivity": {
    "detect_on": "canvas",
    "events": {
      "onhover": {
        "enable": true,
        "mode": "grab"
      },
      "onclick": {
        "enable": true,
        "mode": "push"
      },
      "resize": true
    },
    "modes": {
      "grab": {
        "distance": 140,
        "line_linked": {
          "opacity": 1
        }
      },
      "bubble": {
        "distance": 400,
        "size": 40,
        "duration": 2,
        "opacity": 8,
        "speed": 3
      },
      "repulse": {
        "distance": 200,
        "duration": 0.4
      },
      "push": {
        "particles_nb": 4
      },
      "remove": {
        "particles_nb": 2
      }
    }
  },
  "retina_detect": true
});

});

export default function Welcome() {
  return (
    <div><div id='stars'></div>
    <div id='stars2'></div>
    <div id='stars3'></div>

    <div id="parallax">
      <div class="layer" data-depth="0.6">

        <div class="some-space">
          <h1>Welcome</h1>
        </div>

      </div>
      <div class="layer" data-depth="0.4">
        <div id="particles-js"></div>
      </div>

      <div class="layer" data-depth="0.3">
        <div class="some-more-space1"><a href="https://codepen.io/figo-kolsteren" target="blank">Continue to website</a></div>
      </div>
    </div>
    </div>
  )
}
